import React from 'react';
import './Home.css';
import ProfilePic from './profile-pic.jpg'

const Home = (onRouteChange) => {
	return (
		<div>
			<div id="main-card" style={{"display": "flex", "justify-content": "space-between",
					"width": "90%", "margin": "auto"}}>
				<h2 id="home-title" style={{}}>Welcome to squelchify</h2>
				<br />
				<div>I specialize in making websites squelch.</div>
				<img id="profile-pic" src={ProfilePic} alt="" width="300" height=""/>
			</div>
		</div>
		)
};

export default Home;
